-- INSERT INTO [ISO639_2](Alpha3B,Alpha3T,Alpha2,EnglishNames,FrenchNames) VALUES ('Alpha-3(bibliographic)','Alpha-3(terminologic)','Alpha-2','EnglishName','FrenchName');
-- Source: Adapted from http://www.loc.gov/standards/iso639-2/ISO-639-2_utf-8.txt
DELETE FROM [ISO639_2]


-- qaa-qtz
DECLARE @Alpha3B nchar(1)
DECLARE @Alpha3C nchar(1)
SET @Alpha3B = 'a'
WHILE ASCII(@Alpha3B) <= ASCII('t')
BEGIN
    SET @Alpha3C = 'a'
    WHILE ASCII(@Alpha3C) <= ASCII('z')
    BEGIN
            VALUES ('q' + @Alpha3B + @Alpha3C,NULL,NULL,'Reserved for local use','réservée à l''usage local')
        SET @Alpha3C = CHAR(ASCII(@Alpha3C) + 1)
    END
    SET @Alpha3B = CHAR(ASCII(@Alpha3B) + 1)
END

